functions:
  - name: getContinuationToken(unknown)
    uid: '@azure/arm-eventhub.getContinuationToken'
    package: '@azure/arm-eventhub'
    summary: |-
      Given a result page from a pageable operation, returns a
      continuation token that can be used to begin paging from
      that point later.
    remarks: ''
    isDeprecated: false
    syntax:
      content: 'function getContinuationToken(page: unknown): string | undefined'
      parameters:
        - id: page
          type: unknown
          description: A result object from calling .byPage() on a paged operation.
      return:
        description: The continuation token that can be passed into byPage().
        type: string | undefined
